window.bookSummaryJSON = "<p>Damien was a simple man, cruising on the highway of life. A goddess of temptation lures him into a deal he scoffs at. Superstition is for the foolish. Small problem: She's real, her ritual works, and Damien is magically teleported into a strange new realm.</p> <p>Damien awakens in Nordan, a land of myth and magic. A realm where humans battle legendary creatures for the amusement of the gods. In a war between man and myth. Damien's powers set him above the rest, a lord of life and death - enemy of all. Stranded, but not alone, will he perish, or conquer his way home?</p>"; 
